            name: 'companyTagline',
            title: 'Company Tagline',
            type: 'string',
        },
        {
            name: 'slug',
            title: 'Slug',
            type: 'slug',
            options: {
                source: 'companyname',
                maxLength: 96
            }
        },
        {
            name: 'phone',
            title: 'Phone Number',
            type: 'string'
        },
        {
            name: 'logo',
            title: 'Logo',
